import InstagramIcon from '../assets/Instagram.png';

const Logo = styled(Link)`
    text-decoration: none;
    color: var(--gold);
    font-weight: bold;
    margin: 0 10px;
    transition: color 0.3s ease-in-out;

    &:hover {
        color: var(--jet);
        text-decoration: underline;
    }
`;

const Navlink = styled(Link)`
    text-decoration: none;
    color: var(--jet);
    font-size: 1rem;
    font-weight: 500;
    transition: color 0.3s ease-in-out;

    &:hover {
        color: var(--gold);
        font-weight: bold;
    }
`;

const Header = () => {
